import React from "react";
import { useState } from 'react'
const Gymform = () => {
  const [user, setUser] = useState({ name: "", age: "" })

  const handleChange = () => {
    const name = "";
    const age = "";
    setUser(values => ({ ...values, [name]: age }))
  }

  return (
    <form>
      <label>Enter your name:
        <input
          type="text"

          value={user.name || ""}
          onChange={handleChange}
        />
      </label>
      <label>Enter your age:
        <input
          type="number"
          value={user.age || ""}
          onChange={handleChange}
        />
      </label>
      <input type="submit" />
    </form>
  )
}
export default Gymform;
